style.css:
@-moz-document url-prefix("https://intranet.wiut.uz/") {
.box {
    background-color: #080707 !important;
    border: 2px solid #7d7d7d !important;
}
.navbar-inverse {
    background-image: linear-gradient(to bottom, #272727 0, #000000 100%) !important;
}
.container-fluid {
    background-color: #0a0a0a !important;
}
.innerbox {

    color: #d0d0d0 !important;
}
Style Attribute {
    color: #d0d0d0;
    height: 60%;
    width: 60%;
}
.myblock {

    color: #d0d0d0 !important;
}
body {

    color: #d0d0d0 !important;
    background-color: #080707 !important;
}
.label {

    color: #d0d0d0 !important;
}
.well {
    min-height: 20px;
    padding: 19px;
    margin-bottom: 20px;
    background-color: #080707 !important;
    border: 1px solid #383838 !important;
    border-radius: 4px;
    -webkit-box-shadow: inset 0 1px 1px rgba(0, 0, 0, .05);
    box-shadow: inset 0 1px 1px rgba(0, 0, 0, .05);
}
button,
input,
optgroup,
select,
textarea {
    margin: 0;
    font: inherit;
    color: #d0d0d0 !important;
    background-color: #000 !important;
}
.svg-inline--fa {
    color: #d0d0d0 !important;
}
.bootstrap-select .no-results {
    padding: 3px;
    background: #080707;
    margin: 0 5px;
    white-space: nowrap;
}
.dropdown-menu {
    position: absolute;
    top: 100%;
    left: 0;
    z-index: 1000;
    display: none;
    float: left;
    min-width: 160px;
    padding: 5px 0;
    margin: 2px 0 0;
    font-size: 14px;
    text-align: left;
    list-style: none;
    background-color: #080707;
    -webkit-background-clip: padding-box;
    background-clip: padding-box;
    border: 1px solid #ccc;
    border: 1px solid rgba(0, 0, 0, .15);
    border-radius: 4px;
    -webkit-box-shadow: 0 6px 12px rgba(0, 0, 0, .175);
    box-shadow: 0 6px 12px rgba(0, 0, 0, .175);
}
.panel {

    background-color: #080707;

}
.panel-default>.panel-heading {
    color: #d0d0d0;
    background-color: #080707;
    border-color: #000;
}
.alert-info {
    color: #d0d0d0;
    background-color: #080707;
    border-color: #fff;
}
.btn-primary {
    color: #d0d0d0;
    background-color: #080707;
    border-color: #ffffff;
}
.btn-primary:hover {

    border-color: #616161;
}
.panel-info>.panel-heading {
    color: #d0d0d0;
    background-color: #080707;
    border-color: #fff;
}
.card {
    background: #080707;

}
.viewmorebtn a {
    color: #fff;
    background-color: #1e2225;
    border-color: #fff;

}
.list-group-item {
    position: relative;
    display: block;
    padding: 10px 15px;
    margin-bottom: -1px;
    background-color: #080707;
    border: 1px solid #ddd;

}
a {
    color: #d0d0d0;
    text-decoration: none;
    text-decoration-line: none;
    text-decoration-style: initial;
    text-decoration-color: initial;
}
.container .dynamicTile {
    filter: grayscale(60%);
}
}
